import React from 'react';
import Nav from 'react-bootstrap/Nav';

const nav = props => {
    const links = props.auth ? (
        <Nav.Link href='/workouts'>Workouts</Nav.Link>
    ) : (
        <Nav.Link href='/' exact>Home</Nav.Link>
    );
    return (
        <Nav className="mr-sm-2">
            { links }
        </Nav>
    );
}

export default nav;
